    console.log(data1.members)
    return (
        <div className='bar-chart'>
            <Bar
            data = {{
                labels:data1.members,
                datasets: [{
                    label: '# of votesk',
                    data: [1, 2, 3, 4],
                }

                ]
            }}
            height={400}
            width={600}
            />
        </div>
        )
}

